import React from 'react'
import MovieCard from './MovieCard'

const MovieList = ({title,movies}) => {
    console.log(movies)
    
  return (
    <div>
        <div className='flex overflow-auto'>
            <h1>{title}</h1>
            <div className='flex'>
            {
                movies.map((movie)=>(
                    <MovieCard key={movie.id} posterpath = {movie.poster_path}/>

                ))
            }
            </div>
        </div>
        
    </div>
  )
}

export default MovieList
